            title:"Raipur"
        },
        {
            id:3,
            title:"Delhi"
        },
        {
            id:4,
            title:"Newyork"
        },
    ]



  return (
    <div className='flex item-center justify-around my-6'>
     {
        cities.map((item)=>{
            return(<button className="text-white text-lg font-medium" key={item.id}>{item.title}</button>)
        })
     }

    </div>
  )
}

export default TopButtons
